import React, { Component } from "react";

class AppContainer extends Component {
  state = {
    products: [
      {
        _id: 1,
        title: "Email Wizard",
        content: "",
      },
      {
        _id: 2,
        title: "Document Digitization",
        content: "",
      },
      {
        _id: 3,
        title: "Rules Extraction",
        content: "",
      },
      {
        _id: 4,
        title: "Libor",
        content: "",
      },
      {
        _id: 5,
        title: "Email Wizard",
        content: "",
      },
      {
        _id: 6,
        title: "Email Wizard",
        content: "",
      },
    ],
  };
  render() {
    return (
      <div className="app-container">
        <div className="row">
          {this.state.products.map((product) => (
            <div className="col-sm-12 col-md-4">1</div>
          ))}

          <div className="col-sm-12 col-md-4">2</div>
          <div className="col-sm-12 col-md-4">3</div>
          <div className="col-sm-12 col-md-4">4</div>
          <div className="col-sm-12 col-md-4">5</div>
          <div className="col-sm-12 col-md-4">6</div>
        </div>
      </div>
    );
  }
}

export default AppContainer;
